import React from "react";

const WorkoutWeekTableSVG = (workouts) => {
    return (
        <svg
            xmlns="http://www.w3.org/2000/svg"
            width="352"
            height="600"
            viewBox="0 0 352 600"
        >
            <g fill="none" fillRule="evenodd" stroke="none" strokeWidth="1">
                <g stroke="#979797" transform="translate(1)">
                    <path d="M0.5 0.5H349.5V599.5H0.5z"></path>
                    <path
                        strokeLinecap="square"
                        d="M50.5.504V599M99.5.504V599M149.5.504V599M199.5.504V599M249.5.504V599M298.5.504V599"
                    ></path>
                    <path strokeLinecap="square" d="M0 47.5h350"></path>
                </g>
            </g>
        </svg>
    );
}

export default WorkoutWeekTableSVG;
